async function test() {
  const accounts = await ethers.getSigners();
  const wallet = accounts[0];
  const contract = await ethers.getContractAt("HealerHayleyAvalanche", "0x56b5D7a82b475B969E09fc9352350c1921361a39", wallet);
  const [affectedRaw, healedRaw] = await contract.remainingAffected();
  const affected = affectedRaw.map(a => a.toNumber());
  const healed = healedRaw.map(a => a.toNumber());
  const table = {
    affected: affected.length + healed.length,
    healed: healed.length,
    remaining: affected.length
  }
  console.table(table);

}

